import './App.css';
import Header from './components/Header'
import TitleSection from './components/TitleSection';
import Form from './components/Form';
import { Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Header></Header>
      <div className="language-select">
        <Link to="/en">
          <img src="/images/english.png" alt="English" className="flag-icon" />
        </Link>
        <Link to="/it">
          <img src="/images/italian.png" alt="Italian" className="flag-icon" />
        </Link>
        <Link to="/de">
          <img src="/images/german.png" alt="German" className="flag-icon" />
        </Link>
      </div>
      <TitleSection></TitleSection>
      <Form></Form>
    </div>
  );
}

export default App;
